import React from 'react';
import Logo from '../imgs/logo.png'

function Menu(props){

    return(

        <nav className='navbar navbar-light bg-dark navbar-expand-sm'>
            <div className='navbar-brand d-sm-block logo-navbar'>
                {props.titulo}
                <img src={Logo}></img>    
            </div>
        </nav>

    );

};

export default Menu
